import logo from './logo.svg';
import './App.css';
import './styles.css';
import Header from './components/Header';
import Footer from './components/Footer';
import { MovieGrid } from './components/MovieGrid';

function App() {
  return (
    <div className="App">
      <div className='container'>
      <Header/>
      <MovieGrid></MovieGrid>
      </div>
      <Footer/>
    </div>
  );
}

export default App;
